<!DOCTYPE html>
<html lang="zh">

<head>
    <meta charset="UTF-8">
    <title>online-tool</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
    <meta name="description" content="Zander's Note">
    <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <link rel="stylesheet" href="//assets.zlogs.net/docsify@cdn/lib/themes/vue.min.css" />
</head>

<body>
    <div id="app"></div>
    <script>
        window.$docsify = {
            name: 'online-tool',
            loadSidebar: 'SUMMARY.md',
            loadNavbar: 'info/navbar.md',
            themeColor: '#6688EE',
            topMargin: 20,
            search: 'auto',
            ga: 'UA-149127400-1',
            subMaxLevel: 6,
            notFoundPage: '404.md',
            alias: {
                '/.*/SUMMARY.md': '/SUMMARY.md',
                '/.*/navbar.md': '/info/navbar.md',
            },
        }
    </script>
    <script src="//assets.zlogs.net/docsify@cdn/lib/docsify.min.js"></script>
    <script src="//assets.zlogs.net/docsify@cdn/lib/plugins/search.min.js"></script>
    <script src="//assets.zlogs.net/docsify@cdn/lib/plugins/ga.min.js"></script>
    <script src="//assets.zlogs.net/docsify-copy-code@cdn/dist/docsify-copy-code.min.js"></script>
    <script src="//assets.zlogs.net/docsify-sidebar-collapse@cdn/dist/docsify-sidebar-collapse.min.js"></script>
    <script src="//assets.zlogs.net/docsify-pagination@cdn/dist/docsify-pagination.min.js"></script>
    <script async src="//assets.zlogs.net/static@cdn/web/busuanzi/busuanzi.pure.mini.js"></script>
</body>

</html>
